description:
Storyline

A group of college boys, bored with the every day &quot;gay life&quot; of LA, decide to skip Pride weekend in exchange for a camping trip in the woods. Quickly overcome with boredom in their new surroundings, the boys venture into a game that ultimately unleashes the vengeful spirit of a local legend known as Malice Valeria. Overcome by her deadly plan of tainted love and her thirst to take back what was lost long ago, the boys must now band together before they fall victim to the poisons of a broken heart.





ALL MENUS INCLUDED





ALL SPECIAL FEATURES INCLUDED





REGION FREE



Runtime: 1 Hour 27 Minutes



